package com.example.fptacademysystem.dto;import java.io.Serializable;import java.util.Date;public class SubjectDateInTimetableDTO implements Serializable{    private int timetableid;    private String subjnm;    private Date subjdate;    private String slotofsubjdate;    private int attenteaid;    private int semid;    private boolean attenedit;    private String note;    private int subjdetailsid;    private int stugroid;    private int roomid;    private String removeat;    public SubjectDateInTimetableDTO() {        super();    }    public int getTimetableid() {        return timetableid;    }    public void setTimetableid(int timetableid) {        this.timetableid = timetableid;    }    public String getSubjnm() {        return subjnm;    }    public void setSubjnm(String subjnm) {        this.subjnm = subjnm;    }    public Date getSubjdate() {        return subjdate;    }    public void setSubjdate(Date subjdate) {        this.subjdate = subjdate;    }    public String getSlotofsubjdate() {        return slotofsubjdate;    }    public void setSlotofsubjdate(String slotofsubjdate) {        this.slotofsubjdate = slotofsubjdate;    }    public int getAttenteaid() {        return attenteaid;    }    public void setAttenteaid(int attenteaid) {        this.attenteaid = attenteaid;    }    public int getSemid() {        return semid;    }    public void setSemid(int semid) {        this.semid = semid;    }    public boolean isAttenedit() {        return attenedit;    }    public void setAttenedit(boolean attenedit) {        this.attenedit = attenedit;    }    public String getNote() {        return note;    }    public void setNote(String note) {        this.note = note;    }    public int getSubjdetailsid() {        return subjdetailsid;    }    public void setSubjdetailsid(int subjdetailsid) {        this.subjdetailsid = subjdetailsid;    }    public int getStugroid() {        return stugroid;    }    public void setStugroid(int stugroid) {        this.stugroid = stugroid;    }    public int getRoomid() {        return roomid;    }    public void setRoomid(int roomid) {        this.roomid = roomid;    }    public String getRemoveat() {        return removeat;    }    public void setRemoveat(String removeat) {        this.removeat = removeat;    }}